import React from 'react';
import {
  Container,
  Typography,
  Box,
  Card,
  CardContent,
  Grid,
  Button,
  Paper
} from '@mui/material';
import {
  ShoppingCart as ShoppingCartIcon,
  People as PeopleIcon,
  Security as SecurityIcon,
  Speed as SpeedIcon
} from '@mui/icons-material';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const features = [
  {
    icon: <ShoppingCartIcon sx={{ fontSize: 40 }} />,
    title: 'Item Management',
    description: 'Create, edit, and manage your items with ease. Full CRUD operations with a beautiful interface.'
  },
  {
    icon: <PeopleIcon sx={{ fontSize: 40 }} />,
    title: 'User System',
    description: 'Secure user authentication and authorization with role-based access control.'
  },
  {
    icon: <SecurityIcon sx={{ fontSize: 40 }} />,
    title: 'Secure & Reliable',
    description: 'Built with security best practices including JWT authentication and password hashing.'
  },
  {
    icon: <SpeedIcon sx={{ fontSize: 40 }} />,
    title: 'Fast & Responsive',
    description: 'Optimized for performance with Material-UI components and efficient data handling.'
  }
];

const Home = () => {
  const { user } = useAuth();

  return (
    <Box>
      {/* Hero Section */}
      <Paper
        sx={{
          background: 'linear-gradient(135deg, #1976d2 0%, #42a5f5 100%)',
          color: 'white',
          py: 8,
          mb: 6,
          textAlign: 'center'
        }}
      >
        <Container maxWidth="md">
          <Typography variant="h2" component="h1" gutterBottom>
            Welcome to Humble Pearl
          </Typography>
          <Typography variant="h5" component="p" paragraph>
            A modern full-stack web application built with React, Node.js, Material Design, and MySQL
          </Typography>
          {user ? (
            <Button
              variant="contained"
              color="secondary"
              size="large"
              component={Link}
              to="/dashboard"
              sx={{ mt: 2 }}
            >
              Go to Dashboard
            </Button>
          ) : (
            <Box sx={{ mt: 3 }}>
              <Button
                variant="contained"
                color="secondary"
                size="large"
                component={Link}
                to="/register"
                sx={{ mr: 2 }}
              >
                Get Started
              </Button>
              <Button
                variant="outlined"
                color="inherit"
                size="large"
                component={Link}
                to="/login"
                sx={{ borderColor: 'white', color: 'white' }}
              >
                Login
              </Button>
            </Box>
          )}
        </Container>
      </Paper>

      {/* Features Section */}
      <Container maxWidth="lg">
        <Typography variant="h3" component="h2" align="center" gutterBottom>
          Features
        </Typography>
        <Typography variant="h6" component="p" align="center" color="text.secondary" paragraph>
          Everything you need for a modern web application
        </Typography>

        <Grid container spacing={4} sx={{ mt: 2 }}>
          {features.map((feature, index) => (
            <Grid item xs={12} md={6} key={index}>
              <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                <CardContent sx={{ flexGrow: 1, textAlign: 'center', p: 3 }}>
                  <Box sx={{ color: 'primary.main', mb: 2 }}>
                    {feature.icon}
                  </Box>
                  <Typography variant="h5" component="h3" gutterBottom>
                    {feature.title}
                  </Typography>
                  <Typography variant="body1" color="text.secondary">
                    {feature.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>

        {/* Tech Stack Section */}
        <Box sx={{ mt: 8, textAlign: 'center' }}>
          <Typography variant="h3" component="h2" gutterBottom>
            Built With
          </Typography>
          <Grid container spacing={3} justifyContent="center" sx={{ mt: 2 }}>
            {['React', 'Node.js', 'Express', 'MySQL', 'Material-UI', 'JWT'].map((tech) => (
              <Grid item key={tech}>
                <Paper
                  sx={{
                    p: 2,
                    minWidth: 100,
                    textAlign: 'center',
                    backgroundColor: 'primary.main',
                    color: 'white'
                  }}
                >
                  <Typography variant="h6">{tech}</Typography>
                </Paper>
              </Grid>
            ))}
          </Grid>
        </Box>
      </Container>
    </Box>
  );
};

export default Home;
